void BattleMapDot::SetColor(int fontColor, int backgroundColor)
{
	int Color = fontColor + backgroundColor * 16;
	SetConsoleTextAttribute(GetStdHandle(STD_OUTPUT_HANDLE), Color);
}

void BattleMapDot::PrintS(int count, int font, int background, bool isEndl, int x, int y)
{
	SetColor(font, background);

	for (int i = 0; i < count; i++)
	{
		std::cout << "¤±";
	}

	if (isEndl)
	{
		std::cout << std::endl;
	}
}

void BattleMapDot::gotoxy(int x, int y)
{
	COORD pos = { x,y };
	SetConsoleCursorPosition(GetStdHandle(STD_OUTPUT_HANDLE), pos);
}
